import React, { useEffect } from 'react'
import {Line} from 'react-chartjs-2';


import {
    Chart as ChartJS,
    CategoryScale,
    LinearScale,
    PointElement,
    LineElement,
    Title,
    Tooltip,
    Legend,
    Filler,
  } from 'chart.js';
  
ChartJS.register(CategoryScale, LinearScale, PointElement, LineElement, Title, Tooltip, Legend,Filler);



var config = {
    type: 'line',
   
  };



function ThesesChart({chartData}){

 


  return(
   <Line 
   data={chartData}
   options={config}
  />
  );
}

export default ThesesChart
